import React from 'react';

const MemberCard = ({ name, role, image }) => {
  return (
    <div className="member-card">
      <img src={image} alt={`${name} Image`} />
      <h3>{name}</h3>
      <p><strong>{role}</strong></p>
    </div>
  );
};

export default MemberCard;
